// ==UserScript==
// @name         Stop Anti-Semitism
// @namespace    *
// @version      2024-11-06
// @description  replaces all instances of "Zionist", an attempt to showcase how the anti-semitic dogwhistle is used as a catch-all term for the Jewish people. 
// @author       DanClancySucks
// @match         *://*/*
// @icon         data:image/png;base64,
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/516055/Stop%20Anti-Semitism.user.js
// @updateURL https://update.greasyfork.org/scripts/516055/Stop%20Anti-Semitism.meta.js
// ==/UserScript==

(function() {
    'use strict';

    // Configuration for text replacements
    const replacements = {
        'Zionist' : 'Jewish',
        'Zionists' : 'Jews',
        'zionists' : 'Jews',
        ' Zion ' : ' Jew ',
        'zionist' : 'Jewish',
        'zionism' : 'Jewism',
        'Zionism' : 'Jewism',
        'ZIONIST' : 'JEWISH',
        'ZIonist' : 'Jewish',
        // Add more replacements here
        // "oldText": "newText",
    };

    // Function to replace text in a node
    function replaceText(node) {
        if (node.nodeType === Node.TEXT_NODE) {
            let textContent = node.textContent;
            for (const [oldText, newText] of Object.entries(replacements)) {
                textContent = textContent.replace(new RegExp(oldText, 'g'), newText);
            }
            node.textContent = textContent;
        } else {
            node.childNodes.forEach(replaceText);
        }
    }

    // Start the replacement process
    replaceText(document.body);

    // Observe changes in the DOM and replace text in new nodes
    const observer = new MutationObserver(mutations => {
        mutations.forEach(mutation => {
            mutation.addedNodes.forEach(replaceText);
        });
    });

    observer.observe(document.body, { childList: true, subtree: true });
})();